 (550,'4298cf3b-9f8c-484f-9f4b-75a5fcf3810a','2008-10-31 11:57:18','2008-11-04 11:22:19','en','Actions',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__filter','btn_actions_sub2'),
 (551,'764ebc62-7086-4193-9988-e742448864e5','2008-10-31 11:57:19','2008-11-04 11:22:19','en','Filter list #1','<html><head></head><body><strong>Dynamic Filters</strong><br><br>  Dynamic filters has two parts: the selection list and the matching criteria applied when a list item is selected.<br><br>  Unlike other buttons, the filters list can be a tree of lists up to three levels deep. Hence the need for three lists side-by-side. You know an item in a list has sub items if it has a check mark next to it.<br><br><br>   CREATING FILTER LIST ITEMS<br><br>  For each list you can manually add, delete and reorder items with the controls at the bottom of each list. For each item you add, configure a filter specification (see inline help for filter specification) with the view on the far right.<br><br>  To create a sub-menu under an list item, select \"Create standard sub-menu\" from the actions button at the top of the list (not applicable on the 3rd list).<br><br><br>   BATCH CREATING FILTER SUB-LIST ITEMS<br><br>  There are two batch operations to quickly setup multiple list items from a value list: \"Create static value list...\" and \"Create dynamic value list\". Each option requires that a non sub-list item be selected.<br><br>  1- Create static value list...<br><br>  This option will trigger a form in dialog where you select the filter specification and value list. Each item in the value list will create a sub-list item with the filter specification applied automatically. A real time saver if you have long value lists!<br><br>  2- Create dynamic value list<br><br>  This is slightly different than the static version in that the sub-list items are created at runtime based on the value list items present at user login. As a result you will not see the sub-list items in this interface. The clues that a list item is a dynamic value list is the check mark (denotes a sub-list is present) and the filter specification on the right.<br><br>  This type of filter is great for SaaS implementations where value lists are filtered based on record filter rules. </body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__filter','help_button_filter1'),
 (552,'2064a0dd-f10e-42d6-9c59-bf559e661095','2008-10-31 11:57:19','2008-11-04 11:22:19','en','Filter list #2','See the inline help for the first list.',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__filter','help_button_filter2'),
 (553,'8d12d6be-0cd0-4571-bbce-995dac0507c8','2008-10-31 11:57:19','2008-11-04 11:22:19','en','Filter list #3','See the inline help for the first list.',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__filter','help_button_filter3'),
 (554,'8721e594-68df-4bb8-81a0-4876296fe7c1','2008-10-31 11:57:19','2008-11-04 11:22:19','en','Filter specification','<html><head></head><body>Define one or more filter specifications for the selected list item. <br><br>Note that list items that have children do not need filter specifications.  Use the \"+\" button at the bottom of the list to add filter specification records. Each filter specification is comprised of the following components (very similar to the Servoy relation specification form):  <br><br>1- Table column to filter on. All columns from the current top level table and table columns from relationships are options.  <br>2- Matching operator. =, >, >=, <, <=, !=, and \"like\" are available. <br>3- Value to filter by. This is the search criteria that will be applied to the table column to filter by. When you static value list this value is filled with the value list value.   <br><br>POWER USER TIP: match with a function  Notice that there are two filter types: \"Value\" and \"Function\". \"Value\" works as described above.  The \"Function\" type allows you to apply a method to return the parameter to filter by instead of a static value.  For example this allows you to return the current date.  You can also pass an argument to the function. <br><br>Example: create a function that returns a date search string starting x amount of days from today and ending with today. This search string will be matched up with a date field. Use the argument field to specify how many days before today you want the range to be.  This means you can use the same function on filters labeled \"Last 30 days\", \"Past week\", and \"Today\" by adjusting the argument passed to the function. </body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__filter','help_button_filter_spec'),
 (555,'5273d6e6-bb0e-4099-80d8-0630673381ce','2008-10-31 11:57:19','2008-11-04 11:22:19','en','Button: Tabs','<html><head></head><body>The tabs button allows you to switch out the universal list with forms of your own as configured here. <br><br> For each custom list form, you need to specify a way to get back to the universal list. That functionality is contained in the callback \"CALLBACK_ul_exit_tab()\" -- no parameters.  <br><br>This is advanced functionality with a number of uses. It also requires a bit of work and knowledge if you want to go this route.  <br><br>For example, the lazy man\'s way to implement would be to put a button on your custom list form that triggers the callback to return you to the universal list.  If you want your custom form to have the same look and tab functionality as the universal list, you will need to copy the graphics from the universal list and code the popupmenu functionality for the tab graphic yourself.   To help with this, the tab menu items that you configure on this pane are stored in the code global: navigationPrefs.byNavItemID[solutionPrefs.config.currentFormID].universalList.buttons.tabs. This object will return a null if universal list is not turned, if tabs aren\'t turned on, or if no tab list items are created. If defined, it returns an array.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__tab','help_button_help'),
 (556,'a96ace1d-5a12-4ade-a919-ed7050156b0e','2008-10-31 11:57:19','2008-11-04 11:22:19','en','Replace list','<html><head></head><body>The Power Replace functionality allows the user to replace the contents of a field across the found set of records. This is a very powerful function with options to replace with serial number, field merge, date and value.  <br><br>Since this can be a dangerous feature to allow certain users, you can turn Power Replace off in Access & Control > Groups > User modes.  Records here are the fields available to the user to replace on. Choose fields to add from the field list on the right. Rename the field to something more user friendly for the user to read.  You can optionally add a value list to restrict the values that the user can replace with.  The two checkboxes denote whether this field can be replaced and whether it can be used as a data source to replace with. In that order.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__replace','help_replace'),
 (557,'c18dbc36-08cb-4223-abba-bde6322bf6ec','2008-10-31 11:57:19','2008-11-04 11:22:19','en','Replace columns','These columns are from the table the workflow form is based on. ',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__replace','help_replace_columns'),
 (558,'4b9941c0-e83b-433f-8ea8-1d9c29735181','2008-10-31 11:57:19','2008-11-04 11:22:19','en','Delete selected display item',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__universal_lists_2F_list_display__left_3L_list_display_item','btn_delete'),
