 (571,'2dab4d5c-363b-444f-bd3d-773498ff62db','2008-10-31 11:57:20','2008-11-04 11:22:19','en','Buttons','<html><head></head><body>There are a number of buttons that you can activate and configure when using the universal list. <span color=\"red\">(TODO: change inline help when button bar form is implemented.)</span> These are:<br><br>\n\n- add<br>\n- actions<br>\n- filters<br>\n- reports<br>\n- tabs<br><br>\n\nTo activate a button, click on the check box associated with the button. Further onfiguration help is available inline on the pane associated with each button.<br><br>\n\nNote that the button graphics show the configured items in a drop down here when clicked.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button','help_buttons'),
