 (578,'783c6e8e-d81b-4af3-a801-3619d8d5fa31','2008-10-31 11:57:20','2008-11-04 11:22:19','en','Universal lists','<html><head></head><body>Each navigation item can have one or more universal lists. Manage them here (create, delete, reorder, specify default). The check box denotes the default list display. <br><br> Each universal list needs one or more columns. Set those up below.</body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__universal_lists','help_ul'),
